import React from "react";
import {
    Button,
    Dialog,
    DialogActions,
    DialogContent,
    DialogContentText,
    DialogTitle
} from "@material-ui/core/";
import Add from "@material-ui/icons/Add";

export default class extends React.Component {
    state = {
        open: false
    };

    handleToggle = () => {
        this.setState({
            open: !this.state.open
        });
    };

    render() {
        return (
            <>
                <Button
                    variant="contained"
                    onClick={this.handleToggle}
                    aria-label="add" 
                    color="primary"
                    mini
                >
                    <Add />
                </Button>
                <Dialog aria-labelledby="form-dialog-title">
                    <DialogTitle id="form-dialog-title">
                        Create new exercise
                    </DialogTitle>
                    <DialogContent>
                        <DialogContentText>
                            Please fill out the form below.
                        </DialogContentText>
                    </DialogContent>
                    <DialogActions>
                        <Button color="primary">Create</Button>
                    </DialogActions>
                </Dialog>
            </>
        );
    }
}
